import React from 'react';

import {Navigation} from 'react-minimal-side-navigation';
import 'react-minimal-side-navigation/lib/ReactMinimalSideNavigation.css';
import './Sidebar.css';

function Sidebar() {
    return (
        <>
         <ul class="side-navigation-panel-select">
           <li class="side-navigation-panel-select-wrap">
             <div class="side-navigation-panel-select-option ">
               <span class="side-navigation-panel-select-option-wrap">
                 <span class="side-navigation-panel-select-option-text">
                   JazzTopia
                </span></span></div></li></ul>
          <ul class="side-navigation-panel-select">
            <li class="side-navigation-panel-select-wrap">
              <div class="side-navigation-panel-select-option ">
                <span class="side-navigation-panel-select-option-wrap">
                  <span class="side-navigation-panel-select-option-text">
                    Instruments</span>
                  </span>
                  <svg width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round" class="side-navigation-panel-select-option-icon side-navigation-panel-select-option-icon-chevron-up">
                    <path d="M18 15l-6-6-6 6"></path>
                  </svg>
                </div>
            </li>
            <ul class="side-navigation-panel-select-inner">
              <li class="side-navigation-panel-select-inner-wrap">
                <div class="side-navigation-panel-select-inner-option  ">
                  <span class="side-navigation-panel-select-inner-option-wrap">
                    <span class="side-navigation-panel-select-inner-option-text">
                      Piano</span></span></div></li>
              <li class="side-navigation-panel-select-inner-wrap"><div class="side-navigation-panel-select-inner-option side-navigation-panel-select-inner-option-selected "><span class="side-navigation-panel-select-inner-option-wrap"><span class="side-navigation-panel-select-inner-option-text">Members</span></span></div></li></ul></ul><ul class="side-navigation-panel-select"><li class="side-navigation-panel-select-wrap"><div class="side-navigation-panel-select-option "><span class="side-navigation-panel-select-option-wrap"><span class="side-navigation-panel-select-option-text">Another Item</span></span><svg width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round" class="side-navigation-panel-select-option-icon side-navigation-panel-select-option-icon-chevron-down"><path d="M6 9l6 6 6-6"></path></svg></div></li></ul>
          <Navigation
            // you can use your own router's api to get pathname
            activeItemId="/management/members"
            onSelect={({itemId}) => {
              // maybe push to the route
            }}
            items={[
              {
                title: 'JazzTopia',
                itemId: '/dashboard',
                // you can use your own custom Icon component as well
                // icon is optional
              },
              {
                title: 'Instruments',
                itemId: '/instruments',
                subNav: [
                  {
                    title: 'Piano',
                    itemId: '/management/projects',
                  },
                  {
                    title: 'Members',
                    itemId: '/management/members',
                  },
                ],
              },
              {
                title: 'Another Item',
                itemId: '/another',
                subNav: [
                  {
                    title: 'Teams',
                    itemId: '/management/teams',
                  },
                ],
              },
            ]}
          />
        </>
    );
}

export default Sidebar;
